import Genre from "./Genre.jsx";
import styles from "../App.module.css";
import { Button } from "@chakra-ui/react";

function GenreList() {
	const genres = Genre();
	return (
		<div className={styles.genre}>................... Genres..........
		<ul>
		{genres.map(genre => <button key={genre.title} className={styles.genrelist}> <img className={styles.genreimage} src={genre.image}/><div className={styles.genretitle}> {genre.title}</div></button>)}
		</ul>
		</div>
	);
};

export default GenreList;
